import React, { useState } from 'react';
import { Link, Outlet } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import Insert from '../Components/Insert';
import Display from '../Components/Display';

function SideNavbar() {
  const myNav = useNavigate();
  const [showInsert, setShowInsert] = useState(false);
  const [showDisplay, setShowDisplay] = useState(false);

  const handleLogout = () => {
    myNav("/Home");
  }

  return (
    <>
      <div className="side-navbar">
        <ul>
          <a className="navbar-brand" href="#">Admin Panel</a>
          <ul className="navbar-nav">
            <li className="nav-item">
              <a className="nav-link" href="#"><Link to="admin" className="Nlinks" >Assign</Link></a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#"><Link to="insert" className="Nlinks" onClick={() => setShowInsert(true)}>Assign</Link></a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#"><Link to="display" className="Nlinks" onClick={() => setShowDisplay(true)}>View</Link></a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#"><Link to="Priority" className="Nlinks" >Priority View</Link></a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#"><Link to="manageuser" className="Nlinks" >Users Information</Link></a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#"><Link to="Home" onClick={handleLogout} className="Nlinks" >Logout</Link></a>
            </li>
          </ul>
        </ul>
      </div>

      {showInsert && <Insert />}
      {showDisplay && <Display />}

      <Outlet />
    </>
  );
}

export default SideNavbar;
